import React, { useState, useEffect } from "react";
import axios from "axios";

const DeletePersonal = ({ onDeleteId }) => {
  const [personalData, setPersonalData] = useState([]);
  const [error, setError] = useState(null);

  // Function to fetch personal data
  const fetchPersonalData = async () => {
    try {
      const response = await axios.get("/auth/personal1"); // Adjust the endpoint as needed
      setPersonalData(response.data.data);
    } catch (err) {
      setError(err.message);
    }
  };

  // Function to handle click on ID
  const handleClick = (id) => {
    onDeleteId(id);
  };

  useEffect(() => {
    fetchPersonalData();
  }, []); // Fetch data on component mount

  return (
    <div>
      {error && <p>Error: {error}</p>}
      <div>
        {personalData.map((item) => (
          <div key={item._id} onClick={() => handleClick(item._id)}>
            {item._id}
          </div>
        ))}
      </div>
    </div>
  );
};

export default DeletePersonal;
